pragma solidity ^0.5.10;

import "./AuthChecker.sol";
import "../lib/SafeMath.sol";

contract Identity is AuthChecker {

    // TODO:
    // - need to add functions to revoke and un-revoke. What to do with signerCount?
    // - maybe get rid of revoke altogether? You can always filter events to determine auths
    // - make a single setThreshold() function?

    using SafeMath for uint256;

    /////
    // Constant data
    /////

    // bucket 1 is a 'special' bucket in that it is the ability to approve
    // txs to the address of THIS contract, and therefore to change the authorization
    // threshold, authorized addresses, etc. called recovery bucket bc control over
    // any other buckets can always be recovered with control over bucket 1
    uint public constant RECOVERY_BUCKET = 1;
    uint public constant MAX_UINT = uint(-1);


    /////
    // State data
    /////

    uint public nonce;          // no. txs added
    bool public initialized;    // true after first signer added
    address payable public grave;       // address to self-destruct to (simple withdrawal contract)

    // target => bucket
    mapping (address => uint) public buckets;
    // tx bucket => no. sigs required
    mapping (uint => uint) public thresholds;
    // bucket => no. signers
    mapping (uint => uint) signerCount;

    // user => bucket => isSigner
    mapping (address => mapping (uint => bool)) public signers;
    // user => txId => confirmed
    mapping (address => mapping (uint => bool)) public confirmed;
    // user => access revoked
    mapping (address => bool) revoked;

    // txId => Tx
    mapping (uint => Tx) public txs;

    struct Tx {
        address target;
        uint value;
        uint confirmations;
        bytes data;
        bool executed;
    }

    /////
    // Events
    /////

    // TODO
    event Revoke();
    event AddSigner();
    event RemoveSigner();
    event SelfDestruct();
    event IncreaseThreshold();
    event DecreaseThreshold();
    event Propose();
    event Confirm();
    event Execute();
    event AddTx();

    /////
    // Modifiers
    /////

    // used to require confirmations on txs that change the state of this contract
    modifier onlyIdentity() {
        require(msg.sender == address(this), "identity only-identity");
        _;
    }

    modifier validSigner(uint txId) {
        address _target = txs[txId].target;
        uint bucket = _target == address(this) ?
            RECOVERY_BUCKET :
            buckets[_target];
        require(isSigner(msg.sender, bucket), "identity-not-signer");
        require(!confirmed[msg.sender][txId], "identity-already-confirmed");
        _;
    }

    /////
    // Constructor
    /////
    constructor(address payable _graveAddr)
        public
    {
        grave = _graveAddr;
    }

    /////
    // Auth functions (disberse)
    /////

    function kill()
        public
        onlyAuthorized
    {
        selfdestruct(grave);
        emit SelfDestruct();
    }

    /////
    // Initialization
    /////
    // todo: either need to have 2 separate initialization type functions
    // (one to imitate a constructor and one to set the first signer)
    // or allow only Disberse to call deploy() on the Factory and take
    // the first signer as an argument in the initial deployment.

    // allows Disberse to add the first user EOA
    // todo: this is very close to the same pattern that caused parity hack #2
    // (init function + proxy patter). Auth should prevent any issues, but need
    // to give this some extra thought
    function init(address signer)
        public
        onlyAuthorized
    {
        require(!initialized, "identity-already-initialized");
        initialized = true;
        _addSigner(signer, RECOVERY_BUCKET);
    }

    // bool public constructed;
    // function construct(bytes32 _authority, bytes32 _grace) public {
    //     require(!constructed);
    //     constructed = true;

    //     // set grave
    //     grave = address(bytes20(_authority));

    //     // seth auth
    //     authority = DSAuthority(_authority);
    //     emit LogSetAuthority(_authority);
    // }

    /////
    // Identity only functions (for configuration of this identity)
    /////

    // todo: do these work as external?
    function addSigner(address signer, uint bucket) external onlyIdentity {
        _addSigner(signer, bucket);
    }

    function removeSigner(address signer, uint bucket) external onlyIdentity {
        _removeSigner(signer, bucket);
    }

    function decreaseThreshold(uint bucket) external onlyIdentity {
        _decreaseThreshold(bucket);
    }

    function increaseThreshold(uint bucket) external onlyIdentity {
        _increaseThreshold(bucket);
    }

    // todo: make sure this works
    function addSignerIncreaseThreshold(address _signer, uint bucket)
        external
        onlyIdentity
    {
        _addSigner(_signer, bucket);
        _increaseThreshold(bucket);
    }

    // todo: make sure this works
    function removeSignerDecreaseThreshold(address _signer, uint bucket)
        external
        onlyIdentity
    {
        _decreaseThreshold(bucket);
        _removeSigner(_signer, bucket);
    }

    function burnAccess(uint bucket) external onlyIdentity {
        thresholds[bucket] = MAX_UINT;
    }

    function changeBucket(address target, uint bucket) external onlyIdentity {
        buckets[target] = bucket;
    }



    /////
    // Signer functions
    /////

    // todo: cheaper to read data from memory since it gets passed to _addtx in memory anyway?
    function propose(address target, uint value, bytes memory data)
        public
        returns (uint)
    {
        uint txId = _addTx(target, value, data);
        confirm(txId);
        return txId;
    }

    function confirm(uint txId) public validSigner(txId) {
        confirmed[msg.sender][txId] = true;
        txs[txId].confirmations = (txs[txId].confirmations).add(1);
    }

    function execute(uint txId) public {
        Tx storage _tx = txs[txId];
        require(!_tx.executed, "identity-tx-already-executed");
        // prevents 'signature reentrancy' where getting sigs on tx once could
        // result in calling back in while tx is confirmed but not yet
        // considered executed. reverted if any of the following requires() fail
        _tx.executed = true;

        uint bucket = buckets[_tx.target];
        require(_tx.confirmations >= thresholds[bucket], "identity-threshold-not-reached");
        // require(thresholdReached(txId), "identity-threshold-not-reached");

        // raw call to tx destination with tx value and data
        // in the event of failure, do not consider the transaction executed
        // raw calls now make return data accessible on success. Could be
        // some situations where this is worth accessing
        (bool success, ) = _tx.target.call.value(_tx.value)(_tx.data);
        if (success) {
            emit Execute();
        } else {
            _tx.executed = false;
        }
    }

    /////
    // Internal functions
    /////

    function _addTx(address _target, uint _value, bytes memory _data)
        internal
        returns (uint)
    {
        nonce++;
        Tx storage _tx = txs[nonce];
        _tx.target = _target;
        _tx.value = _value;
        _tx.data = _data;
        emit AddTx();
    }

    function _addSigner(address _signer, uint bucket) internal {
        signerCount[bucket] = signerCount[bucket].add(1);
        signers[_signer][bucket] = true;
        emit AddSigner();
    }

    function _removeSigner(address _signer, uint bucket) internal {
        signerCount[bucket] = signerCount[bucket].sub(1);
        signers[_signer][bucket] = false;
        require(checkAccess(bucket), "identity-min-signers");
        emit RemoveSigner();
    }

    function _decreaseThreshold(uint bucket) internal {
        thresholds[bucket] = thresholds[bucket].sub(1);
        emit DecreaseThreshold();
    }

    function _increaseThreshold(uint bucket) internal {
        thresholds[bucket] = thresholds[bucket].add(1);
        require(checkAccess(bucket), "identity-min-signers");
        emit IncreaseThreshold();
    }


    /////
    // View functions
    /////

    function isSigner(address gal, uint bucket) public view returns (bool) {
        return signers[gal][bucket] && !revoked[gal];
    }

    function checkAccess(uint bucket) public view returns (bool) {
        return thresholds[bucket] >= signerCount[bucket];
    }

    function thresholdReached(uint txId) public view returns (bool) {
        address target = txs[txId].target;
        uint bucket = buckets[target];
        uint threshold = thresholds[bucket];
        uint confirmations = txs[txId].confirmations;
        return confirmations > threshold;
    }
}
